import React, { Component } from 'react'
import VisualizationSocialConnections from "./VisualizationSocialConnections.jsx"
import MatchSearchList from "./MatchSearchList.jsx"

class SearchMatch extends Component {
    render() {
        return (
            <div>

                <div className="d-inline-flex">
               <MatchSearchList/> 
               </div>
               <div  className="d-inline-flex margi">
               <VisualizationSocialConnections/> 
               </div>
            
            </div>
        )
    }
}

export default SearchMatch
